import React from 'react'

function StudentRequestView({request}) {
  return (
<>
   <h4 className='text-center'> Моя заявка на курирование ВКР</h4>
   {request.id && request.is_accepted_request===true && (
    <div> Заявка принята </div>
   )}
   <Row>
    <Col>
    Тема ВКР
    </Col>
    <Col>
    request.theme.name
    </Col>
   </Row>
</>
  )
}

export default StudentRequestView
